import React from 'react';
import "./css/journals-main.css";

const JournalsHeader =()=>{

    return (
        <div className="heading-bar h-r-2 row py-2 m-0">                
            <div className="col-12 px-3">                    
                <h1 className="m-0 cstm-sec-color">Journal <span className='LstBook cstm-semi-grey-color'>Overview</span></h1>                    
            </div>                
        </div>
    );

}

export default JournalsHeader;
